import React from "react";

function SearchBar({ input, onChange }) {
    return (
        <div className="searchbar">
            <img src="./"/>
            <input
                key="random1"
                value={input}
                placeholder={"search..."}
                onChange={(e) => onChange(e.target.value)}
            />
        </div>
    )
}

export default SearchBar;
